function grade($score) {
  if ($score == 4) {
    $grade = 'A';
  }
  elseif ($score == 3.5){
    $grade = 'B+';
  }
  elseif ($score == 3){
    $grade = 'B';
  }
  elseif ($score == 2.5){
    $grade = 'C+';
  }
  elseif ($score == 2){
    $grade = 'C';
  }
  elseif ($score == 1.5){
    $grade = 'D+';
  }
  elseif ($score == 1){
    $grade = 'D';
  }
  elseif ($score <= .5){
    $grade = 'F';
  }
  return $grade;
}

/**
 *  Important Stuff
 * 7 = Score Total
 * 8 = Title
 * 9 = First Name
 * 10 = Last Name
 * 11 = Party
 * 12 = State
 * 13 = District (Some are NULL),
 * 14 = Twitter ID
 * 15 = Youtube ID
 * 16 = Facebook ID
 */

$html = ''; 
foreach ($list as $item) {
  $name = $item[10] . ', ' . $item[9] . ' (' . $item[8] . ')';
  $party = $item[11];
  $state = $item[12];
  $score = $item[7];
  $grade = grade($score);
  $twitter = $item[14];
  
  $table = '';
  $table .= "<tr>\n";
  $table .= "  <td>$name</td>\n";
  $table .= "  <td>$grade</td>\n";
  $table .= "  <td>$party</td>\n";
  $table .= "  <td>$state</td>\n";
  $table .= "  <td>$twitter</td>\n";
  $table .= "  <td></td>\n";
  $table .= "</tr>\n";

  $html .= $table;
}

print($html);


